# --- Custom Toolbar Class ---
class CustomToolbar(NavigationToolbar):
    def __init__(self, canvas, parent):
        # Let's define a default 3D view for reset
        self.default_view = {'elev': 30, 'azim': -60}

        # First, call the parent constructor which creates the standard buttons
        super().__init__(canvas, parent)
        
        # --- Add custom buttons to the LEFT ---
        # Get the first existing action (usually 'Home') to insert before it
        first_action = self.actions()[0]
        
        # Create and insert the view buttons
        button_top_view = QPushButton("Top View")
        button_top_view.clicked.connect(self.set_top_view)
        self.insertWidget(first_action, button_top_view)

        button_side_x_view = QPushButton("Side X View")
        button_side_x_view.clicked.connect(self.set_side_view_x)
        self.insertWidget(first_action, button_side_x_view)

        button_side_y_view = QPushButton("Side Y View")
        button_side_y_view.clicked.connect(self.set_side_view_y)
        self.insertWidget(first_action, button_side_y_view)

        # Add a separator for visual clarity
        self.insertSeparator(first_action)

        # --- Add HELP button to the RIGHT ---
        # Create a spacer widget that will expand to fill the available space
        spacer = QWidget()
        spacer.setSizePolicy(QSizePolicy.Policy.Expanding, QSizePolicy.Policy.Expanding)
        self.addWidget(spacer)

        # add the HELP button, which will be pushed to the far right
        button_help = QPushButton("   HELP   ")
        # Set a unique name for styling with QSS
        button_help.setObjectName("helpButton")
        # Get the standard 'Help' icon and set it on the button
        button_help.setIcon(self.style().standardIcon(QStyle.StandardPixmap.SP_DialogHelpButton))
        # Connect the button click to the parent's show_help method
        button_help.clicked.connect(parent.show_help) 
        self.addWidget(button_help)

    def _get_3d_ax(self):
        """ Finds and returns the 3D axis from the figure, if it exists. """
        for ax in self.canvas.figure.axes:
            if ax.name == '3d':
                return ax
        # If no 3D axes are found, do nothing
        # Accessing siril log via parent widget
        if hasattr(self.parent(), 'siril'):
            self.parent().siril.log("No 3D plot found in the figure.", s.LogColor.RED)
        return None

    # Top view method
    def set_top_view(self):
        """ Sets the 3D plot camera to a top view. """
        ax = self._get_3d_ax()
        if ax:
            # Sets the elevation to 90 degrees (top view)
            # and the azimuth to -90 (standard orientation)
            ax.view_init(elev=90, azim=-90)
            # Asks the canvas to redraw itself
            self.canvas.draw_idle()

    # Side view method
    def set_side_view_x(self):
        """ Sets the camera to a view along the X axis. """
        ax = self._get_3d_ax()
        if ax:
            ax.view_init(elev=0, azim=-90)
            self.canvas.draw_idle()

    # Method for the Y-side view
    def set_side_view_y(self):
        """ Sets the camera to a view along the Y-axis. """
        ax = self._get_3d_ax()
        if ax:
            ax.view_init(elev=0, azim=0)
            self.canvas.draw_idle()

    def home(self):
        """ Overrides the 'home' method to also reset the 3D view. """
        # Call the original 'home' function first to reset zoom and pan.
        super().home()
        
        # Now manually set the 3D view to the stored initial view.
        ax = self._get_3d_ax()
        if ax:
            ax.view_init(elev=self.default_view['elev'], azim=self.default_view['azim'])
            
            # Redraw the canvas
            self.canvas.draw_idle()

